import React, { useState } from 'react';

// In a real app, this would be managed by your backend
const useAdminManagement = () => {
  const [admins, setAdmins] = useState(() => {
    // Load from localStorage if available
    const saved = localStorage.getItem('admin_profiles');
    return saved ? JSON.parse(saved) : [];
  });

  const createAdmin = (adminData) => {
    const newAdmin = {
      id: Date.now().toString(),
      username: adminData.username,
      full_name: adminData.fullName,
      created_at: new Date().toISOString()
    };

    const updatedAdmins = [...admins, newAdmin];
    setAdmins(updatedAdmins);
    localStorage.setItem('admin_profiles', JSON.stringify(updatedAdmins));
    return newAdmin;
  };

  const adminExists = (username) => {
    return admins.some(admin => admin.username === username);
  };

  return { admins, createAdmin, adminExists };
};

const AdminManagement = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    username: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState({ text: '', type: '' });
  const { createAdmin, adminExists } = useAdminManagement();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage({ text: '', type: '' });

    // Simple validation
    if (!formData.fullName || !formData.username || !formData.password) {
      setMessage({ text: 'All fields are required', type: 'error' });
      setLoading(false);
      return;
    }

    if (formData.password.length < 6) {
      setMessage({ text: 'Password must be at least 6 characters', type: 'error' });
      setLoading(false);
      return;
    }

    // Check if admin already exists
    if (adminExists(formData.username)) {
      setMessage({ text: 'Username already exists', type: 'error' });
      setLoading(false);
      return;
    }

    // Simulate API call
    setTimeout(() => {
      try {
        // In a real app, you would send this to your backend
        const newAdmin = createAdmin(formData);

        setMessage({
          text: `✅ Admin account for ${formData.fullName} created successfully!`,
          type: 'success'
        });

        // Reset form
        setFormData({
          fullName: '',
          username: '',
          password: ''
        });
      } catch (error) {
        console.error('Error creating admin:', error);
        setMessage({
          text: 'Failed to create admin account',
          type: 'error'
        });
      } finally {
        setLoading(false);
      }
    }, 1000);
  };

  return (
    <div className="p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-semibold mb-6">Create New Admin Account</h2>

      {message.text && (
        <div className={`mb-4 p-3 rounded ${message.type === 'success' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
          {message.text}
        </div>
      )}

      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label htmlFor="fullName" className="block text-sm font-medium text-gray-700 mb-1">
            Full Name
          </label>
          <input
            type="text"
            id="fullName"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div>
          <label htmlFor="username" className="block text-sm font-medium text-gray-700 mb-1">
            Username
          </label>
          <input
            type="text"
            id="username"
            name="username"
            value={formData.username}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div>
          <label htmlFor="password" className="block text-sm font-medium text-gray-700 mb-1">
            Password
          </label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
            minLength="6"
          />
          <p className="mt-1 text-sm text-gray-500">Password must be at least 6 characters long</p>
        </div>

        <div className="pt-2">
          <button
            type="submit"
            disabled={loading}
            className={`w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 ${loading ? 'opacity-75 cursor-not-allowed' : ''}`}
          >
            {loading ? 'Creating...' : 'Create Admin Account'}
          </button>
        </div>
      </form>
    </div>
  );
};

export default AdminManagement;
